import {useState, useEffect} from "react";
import axios from "axios";
import {Link} from 'react-router-dom';

const Home = () => {
    const [login, setLogin] = useState({
        data : {}
    });

    useEffect(()=> {
        axios.get('/login')
            .then((res) => {
                setLogin(res?.data);
        });
    }, [])

    console.log(login);

    return(
        <div id="home">
            {/* <h1> Home Page </h1>
            <p> App_Board Front Tutorial </p>

            <Link to="/member"><button id="btn-default" style={{width: "100px", height: "50px"}}> Sign in </button></Link> <br/><br/>

            <Link to="/board"><button id="btn-default"> Board </button></Link>
            <Link to="/category"><button id="btn-default"> Category </button></Link> */}
            <div class="container">
                <form class="form-signin" method="post" action="/login">
                    <h2 class="form-signin-heading">Please sign in</h2>
                    <p>
                        <label for="username" class="sr-only">Username</label>
                        <input type="text" id="username" name="username" class="form-control" placeholder="Username" required autofocus/>
                    </p>
                    <p>
                        <label for="password" class="sr-only">Password</label>
                        <input type="password" id="password" name="password" class="form-control" placeholder="Password" required/>
                    </p>
                        <input name="_csrf" type="hidden" value="af226a34-6934-4e3b-b60d-dfe50903a34a" />
                        <button class="btn btn-lg btn-primary btn-block" type="submit">Sign in</button>
                </form>
            </div>
        </div>
    );
};

export default Home;
